-- -----------------------------------------------------
-- Create Table `laniak_db`.`products`
-- -----------------------------------------------------

drop table if exists products;

create table if not exists products(
    id int unsigned auto_increment not null,
    created_at timestamp null default null,
    updated_at timestamp null default null,
    name varchar(50) not null,
    description varchar(600) null default 'no description',
    price dec(8,2) not null,
    image varchar(255) not null,
    brand_id int unsigned default null,
    cart_id int unsigned default null,
    primary key(id),
    key fk_products_brand_idx (brand_id asc) visible,
    key fk_products_cart_idx (cart_id asc) visible,
    constraint fk_products_brand_idx
        foreign key (brand_id)
        references brands (id),
    constraint fk_products_cart_idx
        foreign key (cart_id)
        references carts (id)
);

